import { createSlice } from '@reduxjs/toolkit';

const gottenStoreData = ""

  const dataSlice = createSlice({
    name: "data",
    initialState,
    reducers: {
      dataInsert(action) {
        gottenStoreData = action.payload
      }
    }
  
  })

  export const dataActions = dataSlice.actions

  export default dataSlice.reducer
